    Iterator<Preference> prefsIterator=prefs.iterator();
    while (prefsIterator.hasNext()) {
      Preference pref=prefsIterator.next();
      if (pref.getItemID() == itemID) {
        prefsIterator.remove();
        break;
      }
    }
  }
