        boolean allSelectedIsTag=true;
        for (        TreePath treePath : paths) {
          Object tagObj=treePath.getLastPathComponent();
          if (tagObj instanceof TagNode) {
            Object tag=((TagNode)tagObj).tag;
            if (!(tag instanceof Tag)) {
              allSelectedIsTag=false;
              break;
            }
          }
