  int code=(int)character;
  int pos=-1;
  boolean exists=false;
  for (int i=0; i < font.glyphInfo.size(); i++) {
    if (font.glyphInfo.get(i).glyphCode >= code) {
      if (font.glyphInfo.get(i).glyphCode == code) {
        exists=true;
